commits.sourceNew:
private void addDocs(DocsEnum docsEnum, OpenBitSet bits) throws IOException {
  int docid;
  while ((docid = docsEnum.nextDoc()) != DocIdSetIterator.NO_MORE_DOCS) {
    bits.fastSet(docid);
  }
}

